description:
A chopper pulls up to another. Glances are exchanged. Engines rev. Pistons move. When Vivid Girls have a bike between their legs it's only a matter of time before it's replaced with something more ... well ... human. Paul Thomas presents Sunny and Cher ... a story about two girls and their bikes. Sunny squirts. Lux does her first scene. And then they refuel and do another lap. Right on. Ride on. story about two girls and their bikes.

